              </div>
            </div>
            <div class="col-xs-6 col-md-3">
              <div class="panel panel-default">
                <div class="panel-body easypiechart-panel">
                  <h4>No. of Visits</h4>
                  <div
                    class="easypiechart"
                    id="easypiechart-red"
                    data-percent="46"
